                "shop_name": "RookDesignCo",
                "user_id": 11320115,
                "creation_tsz": 1325129268,
                "title": "Rook Design Company : : Custom Paper Goods",
                "announcement": "Howdy neighbor! I am a savvy southern designer who specializes in custom wedding goods. Anything from invitations to koozies! I am on a quest to save the printed paper good. Screw Evite. God Save the Ream!\r\n\r\nPlease check out my FAQ for koozie pricing and info. Here are the available quantities:\r\n12 (minimum) = $79\r\n25 koozies = $88\r\n30 koozies = $100\r\n50 koozies = $108\r\n75 koozies = $140 (yes it costs more because of bulk discounts!)\r\n100 koozies = $134\r\n125 koozies = $144\r\n150 koozies = $176 (yes it costs more because of bulk discounts!)\r\n175 koozies = $180\r\n200 koozies = $158\r\n250 koozies = $188\r\n300 koozies = $218\r\n350 koozies = $238\r\n400 koozies = $262\r\n500 koozies = $326\r\n(prices include tax and shipping to the U.S.)\r\n\r\nContact me about International shipping prices. ",
                "currency_code": "USD",
                "is_vacation": false,
                "vacation_message": null,
                "sale_message": "Howdy and thanks for shopping! I am a small, one woman shop which means it may take up to 48 HOURS to receive your proof. \r\n\r\nEach design was made with southern pride and if you have any concerns or questions regarding your purchase don&#39;t hesitate to contact me. If you are happy with your product, please leave me a kind word or two, or even if you just feel like saying hi.\r\n\r\nColors on screen may vary from the actual product. Printed koozies are non-refundable.\r\n",
                "digital_sale_message": null,
                "last_updated_tsz": 1410285269,
                "listing_active_count": 327,
                "login_name": "altech04",
                "accepts_custom_requests": true,
                "policy_welcome": "Howdy! \r\n\r\nI am a professional Graphic Designer living in the cozy Observatory Park area of Denver. I am originally from Texas, and spend my weekends pretending to ski and exploring my new state!\r\n\r\nMost of my designs are customized per client. Feel free to email me with ideas, but I am not keen on copying another designer&#39;s work, or using any copyrighted material.\r\n\r\nI&#39;m always interested in chatting with people who visit my site, so kick back... stay awhile.. and feel free to contact me with any feedback or questions. Thx!\r\n\r\n: : Allison : :",
                "policy_payment": "I currently accept payment in the form of PayPal and you can also pay via major credit cards through Etsy&#39;s Direct checkout\r\n\r\nIn the event of a unique scenario please contact me directly and we can discuss an alternative arrangement. Taxes are based on my current state of residence, Colorado. \r\n\r\n",
                "policy_shipping": "Koozies ship directly from the printer within 3 weeks of the time you place your order. Rush production fees of $40 can increase the delivery time by 2 business days. \r\n\r\nGenerally koozies cannot be made in less than 10 business days. \r\n\r\nPlease alert me if you require delivery confirmation ",
                "policy_refunds": "To cancel an order [oh no!] please contact me as soon as humanly possible. For printed koozies, there are no refunds. :(",
                "policy_additional": "FAQs\r\n\r\nQ: How much for XX amount of koozies?\r\n--\r\nA: Below is a list of the available quantities. Any amount other than what is listed is NOT available. Because it is typically more expensive than ordering a bulk amount. So rounding up to a higher quantity saves you money!!\r\n12 (minimum) = $79\r\n25 koozies = $88\r\n30 koozies = $100\r\n50 koozies = $108\r\n75 koozies = $140 (yes it costs more because of bulk discounts!)\r\n100 koozies = $134\r\n125 koozies = $144\r\n150 koozies = $176 (yes it costs more because of bulk discounts!)\r\n175 koozies = $180\r\n200 koozies = $158\r\n225 koozies = $180\r\n250 koozies = $188\r\n300 koozies = $218\r\n350 koozies = $238\r\n400 koozies = $262\r\n500 koozies = $326\r\n\r\nQ: Can I do fewer than 12 koozies?\r\n--\r\nA: I&#39;m afraid 12 is the minimum my printer will run, so yay for extras!\r\n\r\n\r\nQ: Can I do more than one color of koozie per order?\r\n--\r\nA: Yes, if you order at least 25, you can order 2 koozie colors. For orders over 50, you can select up to 4 koozie colors.\r\n\r\n\r\nQ: Do you have other colors available than what is shown in the swatches?\r\n--\r\nA: Not at this time.\r\n\r\n\r\nQ: Can I mix and match phrases? For example, doing half &quot;Love Laughter&quot; and half the order &quot;Have & Hold&quot;?\r\n--\r\nA: No. We can only do one set of artwork per order. If you would like more than one phrase, we can do two separate orders at a slight discount. Please contact me for details.\r\n\r\n\r\nQ; Why I haven&#39;t I received a proof yet?\r\n--\r\nA: I have a full time job. And do Etsy nights and weekends. Typically I can get a proof to you within 48 hours, but if you have not heard from me, please be patient. \r\n\r\n\r\nQ; How many revisions can I get?\r\n--\r\nA: Prior to ordering I am happy to provide 3 complimentary proofs. Any additional edits are charged at $20 per round. However, if you actually purchase an item, I am happy to work with you until the proof is correct. \r\n\r\n\r\n",
                "policy_seller_info": "Hi there. I&#39;m a Graphic Designer with a BFA in Graphic Design and an MA in Visual Culture. I have a full time job as a Graphic Designer and consider myself a classically trained professional. My designs are the result of countless hours of design classes and critiques. Built on the foundations of typography, proportion and balance, I consider myself fortunate to get paid to do what I love. \r\n\r\nI currently live in Denver and work for a large in house Marketing Department. Beacuse I have a full time job, it may take up to 72 hours to respond.  More information about me and my work can be found at: rookdesigncompany.com.",
