                "announcement": "Groomsmen Gifts, Groomsmen Ammo Box, Beer Growler, Wine Rack, Bridesmaid gifts, Groomsmen Flasks, Watch box, Rustic Wedding, Personalized Wedding Gift, Toasting Glasses,Gifts for Mom,Gifts for Dad,Kids Guitar, Men, Drinking Glasses, Mason Jar Glasses, Wooden Spoons,Gifts for Men, Gifts for Groomsmen, Custom Wedding Gifts... ",
                "currency_code": "USD",
                "is_vacation": false,
                "vacation_message": null,
                "sale_message": "--&gt;Customers: Please verify the shipping address on this invoice is correct. Your order confirmation will be sent via Etsy&#39;s Convo System within 48 hours. ** Please Log Into Your Etsy Account to read it & answer any questions we may have.**  Thank you so much for your Purchase! We appreciate your business.\r\n",
