            "title": "Beer Box Cowboy Hats. Made from recycled Limited Edition Stars and Stripes Budweiser beer boxes.  Beerhat.",
            "description": "If you have questions about my hats or would like information on wholesale pricing, you can call or text (270) 791-6181.\r\n\r\nBe the life of the party with these very cool Cowboy Hats made from recycled Limited Edition Stars and Stripes Budweiser beer boxes. These cowboy hats are similar to Stetson style cowboy hats. They are made with quality in mind and are very sturdy, so you can rest assured that they will last a very long time. These are great for Nascar events, parties, tailgating, or just for decoration in the bar or game room. A 1&quot; elastic band allows this hat to fit most people from 6 1/2 to 7 5/8, but feel free to contact us if you need a special size. We can make these for most brands of beer that come in a 24 or 18 pack box of cans, so let us know if there is a certain brand you are looking for. It takes 3 case boxes to make 1 hat so please allow enough time for us to consume the beer. ;-) Hats will be shipped using FedEx ground. We work hard to make the best beer hats that you can buy. You will be very happy with your purchase.",
